// Check if crm_api_key exists and is not undefined or "undefined"
if (!$json["crm_api_key"] || $json["crm_api_key"] === "undefined") {
  return [{ json: { error: "crm_api_key is undefined or missing" } }];
}

try {
  // Parse the crm_api_key field (it's a JSON string with an array inside)
  const crmApiKey = JSON.parse($json["crm_api_key"]);

  // Check if crmApiKey is an array and has at least one element
  if (!Array.isArray(crmApiKey) || crmApiKey.length === 0) {
    return [{ json: { error: "crm_api_key is not a valid array or is empty" } }];
  }

  // The first element of the array is the response object
  const response = crmApiKey[0];

  // Return the parsed response with access_token, refresh_token, etc.
  return [{ json: response }];
} catch (error) {
  // Return error details for debugging
  return [{ json: { error: "Failed to parse JSON", details: error.message } }];
}
